import Navbar from "../components/Navbar";
import classes from "../styles/Services.module.css";
import safe from "../images/safe-space.png";
import plant from "../images/individual-background.jpg";
import Footer from "../components/Footer";
import plant2 from "../images/group-background.jpg";

export default function Services() {
  const individualBackground = {
    backgroundImage: `url(${plant})`,
    backgroundSize: 'cover',
    backgroundRepeat: `noRepeat`,
    marginTop: '0vh',
    // objectFit: 'cover',
    alt: 'Photo by Scott Webb from Pexels'
  };
  const groupBackground = {
    backgroundImage: `url(${plant2})`,
    backgroundSize: 'cover',
    backgroundRepeat: `noRepeat`,
    marginTop: '0vh',
    objectFit: 'cover',
    alt: 'Photo by Scott Webb from Pexels'
  };


  return (
    <div>
      <Navbar />
      <div className={classes.header} style={individualBackground}>
        <div className={`${classes.individual} ${classes.nanumMyeongjoRegular}`}><h1>Individual Therapy</h1></div>
        <img alt="All Are Welcome Logo with Pride Inclusive Rainbow Heart" className={classes.safeImg} src={safe} />
      </div>
      <div className={`${classes.topText} ${classes.robotoRegular }`}>
        <p>Therapy can help you heal from past experiences, improve your well-being, relieve distress, and develop new ways of thinking. It can be difficult to make the decision to start seeing a therapist. My goal is to provide a safe and affirming environment in which you can explore your life story and process your feelings without shame or fear of judgement.</p>
        <p>I approach individual therapy sessions with collaboration in mind. Together, we will explore your understanding of yourself and work towards self acceptance. This process can help you to gain insight and self-understanding, which can lead to more balance in your life.</p>
        <p>My philosophy includes an understanding and appreciation of intersectionality. I hold space for your whole self, including the ways that the various identities you hold shape your experience. I provide a safe space for individuals of all sexual orientations, gender identities, abilities, races, ethnicities, spiritual practices, etc.</p>
      </div>
      <div className={classes.group} style={groupBackground} alt="Photo by Element5 Digital"></div>
      <Footer />
    </div>
  )
}
